import { Button } from "@material-ui/core";
import React, { useContext } from "react";
import "./dashbord.css";
import Grid from "@material-ui/core/Grid";
import NewContext from './newContex';
import { PropTypes } from 'prop-types';

const NewButtons = (itemValue,handelClick) => {

  return (
        <Grid
          item
          xs={12}
          className="literals"
          container
          direction="row"
          justify="flex-start"
          alignItems="flex-start"
        >
          <Grid item xs={2} className="part1">
            <Button value={itemValue} onClick={handelClick}>
            +
            </Button>
            <Button value={itemValue} onClick={handelClick}>
              -
            </Button>
            <Button value={itemValue} onClick={handelClick}>
              *
            </Button>
            <Button value={itemValue} onClick={handelClick}> =</Button>
          </Grid>
          <Grid item xs={2} className="part1">
            <Button value={itemValue} onClick={handelClick}> / </Button>
            <Button value={itemValue} onClick={handelClick}>
              %
            </Button>
            <Button value={itemValue} onClick={handelClick}>
            x&sup2;
            </Button>
            <Button value={itemValue} onClick={handelClick}>
            &radic;
            </Button>
          </Grid>
          <Grid item xs={8} className="part2">
            <Button name="" onClick={handelClick}>1</Button>
            <Button name="" onClick={handelClick}>2</Button>
            <Button name="" onClick={handelClick}>3</Button>
            <Button name="" onClick={handelClick}>4</Button>
            <Button name="" onClick={handelClick}>5</Button>
            <Button name="" onClick={handelClick}>6</Button>
            <Button name="" onClick={handelClick}>7</Button>
            <Button name="" onClick={handelClick}>8</Button>
            <Button name="" onClick={handelClick}>9</Button>
            <Button name="" onClick={handelClick}>0</Button>
            <Button name="" onClick={handelClick}>.</Button>
            <Button name="" onClick={handelClick}>C</Button>
          </Grid>
        </Grid>
  );
};
NewButtons.propTypes = {
  numberValue :PropTypes.string,
  handelClick :PropTypes.func
};
export default NewButtons;
